using SFC.Player.Application.Common.Constants;
using SFC.Player.Application.Common.Exceptions;
using SFC.Player.Application.Common.Mappings.Converters;
using SFC.Player.Application.Features.Player.Common.Dto;
using SFC.Player.Application.Features.Player.Common;
using SFC.Player.Domain.Enums;

namespace SFC.Player.Application.UnitTests.Common.Mappings.Converters;
public class PlayerFileTypeConverterTests
{
    [Fact]
    [Trait("Mapping", "PlayerFileTypeConverter")]
    public void Mapping_PlayerFileTypeConverter_ShouldConvert()
    {
        // Arrange
        string base64 = "";
        PlayerFileTypeConverter converter = new();

        // Act
        PlayerPhotoDto? result = converter.Convert(base64, null, null!);

        // Assert
        Assert.NotNull(result);
        Assert.Equal(40481, result.Size);
        Assert.Equal("Photo", result.Name);
        Assert.NotNull(result.Source);
        Assert.Equal(PhotoExtension.Png, result.Extension);
    }

    [Fact]
    [Trait("Mapping", "PlayerFileTypeConverter")]
    public void Mapping_PlayerFileTypeConverter_ShouldReturnNullIfBase64StringIsEmptyOrNull()
    {
        // Arrange
        string base64 = string.Empty;
        PlayerFileTypeConverter converter = new();

        // Act
        PlayerPhotoDto? result = converter.Convert(base64, null, null!);

        // Assert
        Assert.Null(result);
    }

    [Fact]
    [Trait("Mapping", "PlayerFileTypeConverter")]
    public void Mapping_PlayerFileTypeConverter_ShouldThrowBadRequestExceptionIfExtensionIsNotFound()
    {
        // Arrange
        string base64 = "TyA9IEdMLTAwMDAxNy8yMDIwLUlUVV9Bc3BpcmUgR2xvYmFsIDcgTHRkLg0KTCA9IFNsaWVtYQ0KRSA9IG5pa29sYXNAY2hldnJvbi5ncm91cA0KQyA9IERFDQpDTiA9IEdMLTAwMDAxNy8yMDIwLUlUVV9Bc3BpcmUgR2xvYmFsIDcgTHRkLg0KDQo1MDAxZWENCg0KNTAwNDVi";
        PlayerFileTypeConverter converter = new();

        // Act
        BadRequestException assertException = Assert.Throws<BadRequestException>(() => converter.Convert(base64, null, null!));

        // Assert
        Assert.NotNull(assertException);
        Assert.Equal(Messages.ValidationError, assertException.Message);
        Assert.NotNull(assertException.Errors);
        Assert.True(assertException.Errors.ContainsKey(nameof(PlayerGeneralProfileDto.Photo)));
        Assert.Single(assertException.Errors[nameof(PlayerGeneralProfileDto.Photo)]);
        Assert.Equal(Messages.InvalidPhotoExtension, assertException.Errors[nameof(PlayerGeneralProfileDto.Photo)].FirstOrDefault());
    }
}
